  // javascript/hover-circle.js
  document.addEventListener("DOMContentLoaded", function() {
    const cursorText = "Skaityti<br>daugiau";
    const cursor = document.createElement("div");
    cursor.classList.add("custom-cursor");
    cursor.innerHTML = cursorText;
    document.body.appendChild(cursor);
    gsapWithCSS.set(cursor, { xPercent: -50, yPercent: -50, autoAlpha: 0, scale: 0 });
    let xTo = gsapWithCSS.quickTo(cursor, "x", { duration: 0.15, ease: "power3" });
    let yTo = gsapWithCSS.quickTo(cursor, "y", { duration: 0.15, ease: "power3" });
    function handleCursor() {
      if (window.innerWidth >= 1023) {
        window.addEventListener("pointermove", onPointerMove);
        aboutSection.addEventListener("mouseenter", onSectionEnter);
        aboutSection.addEventListener("mouseleave", onSectionLeave);
      } else {
        gsapWithCSS.set(cursor, { autoAlpha: 0 });
        window.removeEventListener("pointermove", onPointerMove);
        aboutSection.removeEventListener("mouseenter", onSectionEnter);
        aboutSection.removeEventListener("mouseleave", onSectionLeave);
      }
    }
    function onPointerMove(e) {
      xTo(e.clientX);
      yTo(e.clientY);
    }
    function onSectionEnter() {
      gsapWithCSS.to(cursor, {
        autoAlpha: 1,
        scale: 1,
        duration: 0.3,
        ease: "power2.out"
      });
    }
    function onSectionLeave() {
      gsapWithCSS.to(cursor, {
        autoAlpha: 0,
        scale: 0,
        duration: 0.3,
        ease: "power2.in"
      });
    }
    const aboutSection = document.querySelector("#about-section");
    if (aboutSection) {
      handleCursor();
      window.addEventListener("resize", handleCursor);
    }
  });

