  // javascript/ajax-product-archive-load.js
  document.addEventListener("DOMContentLoaded", function() {
    let page = 2;
    let loading = false;
    const container = document.querySelector("ul.products");
    if (!container) {
      console.warn(
        "Container element 'ul.products' not found. Exiting script."
      );
      return;
    }
    const productList = container.closest("#product-list");
    const category = productList ? productList.getAttribute("data-category") : null;
    const loadMoreOnScroll = () => {
      if (window.innerHeight + window.scrollY >= document.body.offsetHeight - 500 && !loading) {
        loading = true;
        const data = new FormData();
        data.append("action", "load_more_products");
        data.append("page", page);
        if (category) data.append("category", category);
        fetch(woocommerce_params.ajax_url, {
          method: "POST",
          body: data
        }).then((response) => response.text()).then((response) => {
          if (response == "0") {
            window.removeEventListener("scroll", loadMoreOnScroll);
          } else {
            container.insertAdjacentHTML("beforeend", response);
            page++;
            loading = false;
            const newProducts = container.querySelectorAll("li.product-card");
            newProducts.forEach((product) => {
              product.style.opacity = "0";
              product.style.transition = "opacity 0.5s ease";
              setTimeout(() => product.style.opacity = "1", 50);
            });
          }
        }).catch(
          (error) => console.error("Error loading more products:", error)
        );
      }
    };
    window.addEventListener("scroll", loadMoreOnScroll);
  });

